import React, {useEffect} from 'react';
import BentoGrid from "@bentogrid/core";

const NewHome = () => {
    useEffect(() => {
        const myBento = new BentoGrid({
            target: '.bentogrid',
            cellGap: 10,
            balanceFillers: true,
            columns: 4,

        });
      }, []);
    
    return (
        <div className='background'>
            <div className='boxes'>
            <div class="bentogrid">
            <div className='box' data-bento="1x1"></div>
            <div className='box' data-bento="2x1"></div>
            <div className='box' data-bento="2x1"></div>
            <div className='box' data-bento="1x2"></div>
            <div className='box' data-bento="1x1"></div>
            </div>
            </div>
        </div>
    );
}

export default NewHome;
